import React from 'react';
import OpportunityCard from '../cards/opportunity/OpportunityCard.jsx';
import CardsCarousel from '../cards/carousel/CardsCarousel.jsx';
import OrganizationCard from '../cards/organization/OrganizationCard.jsx';
import PersonCard from '../cards/person/PersonCard.jsx';

export default getCard = (result) => {
    switch (result["type"]) {
        case "opportunity":
            return <OpportunityCard opportunity={(result["result"])}/>

        case "people":
            return (
                <CardsCarousel>
                    <PersonCard/>
                    <PersonCard/>
                    <PersonCard/>
                </CardsCarousel>
            )

        case "organization":
            return (
                <CardsCarousel>
                    <OrganizationCard/>
                    <OrganizationCard/>
                    <OrganizationCard/>
                </CardsCarousel>
            )


    }
}
